const styles = (theme) => ({
  title: {
    marginTop: `${theme.spacing(6)}px !important`,
    paddingBottom: `1px`,
    textTransform: 'uppercase',
    fontWeight: theme.typography.fontWeightBold,
    fontSize: theme.typography.pxToRem(14),
  },

  description: {
    width: '100%',
    marginBottom: 5,
  },

  details: {
    display: 'flex',
    flexWrap: 'wrap',
    paddingTop: theme.spacing(2),
    width: '100%',
  },
});

export default styles;
